const Services = () => {
    const descriptions = [
        {
          title1: "Front End Web Development",
          desc1: "Developing the Front End using the latest technologies, leveraging HTML5/CSS3, design systems like Fluent, Elastic UI, and adding dynamic functionality with JavaScript and React.js.",
        },
        {
            title12: "Front End Web Development",
            desc2: "Developing the Front End using the latest technologies, leveraging HTML5/CSS3, design systems like Fluent, Elastic UI, and adding dynamic functionality with JavaScript and React.js.",
        },
        {
            title13: "Front End Web Development",
            desc3: "Developing the Front End using the latest technologies, leveraging HTML5/CSS3, design systems like Fluent, Elastic UI, and adding dynamic functionality with JavaScript and React.js.",
        },



      ];

  return (
    <section className="section" id="services">
      <div className="section-heading">
        <h3 className="title is-2">Services</h3>
        <h4 className="subtitle is-5">What can I do for you?</h4>
      </div>
    </section>
  );
};

export default Services;
